import React from 'react';
import styles from './Header.module.css';
import image from '../../images/logo.jpeg'
const Header = () => {
    return (
        <header className={styles.header}>
            <nav className={styles.nav}>
                <div>
                    <img src={image} alt="elite logo" />
                </div>
                <h1>Elite Shell</h1>
            </nav>
        </header>
    );
}

export default Header;
